/**
 * IDを定義する.
 * @param name 定数名
 * @param value 定数値
 * @return 定数値
 */
CMonsterDataMaker.RegisterId = function (name, value) {
	if (name != "MONSTER_ID_UNKNOWN") {
		CGlobalConstManager.DefineEnum("EnumMonsterId", [name], value, undefined);
	}
	return value;
};





