/**
 * 旧式データへの移行.
 */
CMonsterDataMaker.ConvertToOldFormat = function () {

	var idx = 0;

	var monsterData = null;

	MonsterObjNew = new Array();

	for (idx = 0; idx < MonsterObjOrg.length; idx++) {

		monsterData = new Array();

		// 読み仮名のデータインデックスを変更する
		monsterData = monsterData.concat(MonsterObjOrg[idx].slice(0, 2));
		monsterData = monsterData.concat(MonsterObjOrg[idx].slice(3, 24));
		monsterData = monsterData.concat(MonsterObjOrg[idx].slice(2, 3));
		monsterData = monsterData.concat(MonsterObjOrg[idx].slice(24));

		MonsterObjNew.push(monsterData);
	}
};



/**
 * 導出データの計算.
 */
CMonsterDataMaker.CalcExtraData = function () {

	var idx = 0;

	for (idx = 0; idx < MonsterObjNew.length; idx++) {

		// 必中
		MonsterObjNew[idx][MONSTER_DATA_EXTRA_INDEX_100HIT] = 100 + MonsterObjNew[idx][MONSTER_DATA_INDEX_LEVEL] + MonsterObjNew[idx][MONSTER_DATA_INDEX_AGI] + 100;

		// 95%回避
		MonsterObjNew[idx][MONSTER_DATA_EXTRA_INDEX_95FLEE] = 150 + MonsterObjNew[idx][MONSTER_DATA_INDEX_LEVEL] + MonsterObjNew[idx][MONSTER_DATA_INDEX_DEX] - 5;

		// 最小ATK、最大ATK
		if (MonsterObjNew[idx][MONSTER_DATA_INDEX_QUALIFIED] == 1){
			MonsterObjNew[idx][MONSTER_DATA_EXTRA_INDEX_ATK_MIN] = MonsterObjNew[idx][MONSTER_DATA_INDEX_LEVEL] + MonsterObjNew[idx][MONSTER_DATA_INDEX_STR] + Math.floor(MonsterObjNew[idx][MONSTER_DATA_INDEX_ATK] * 0.8);
			MonsterObjNew[idx][MONSTER_DATA_EXTRA_INDEX_ATK_MAX] = MonsterObjNew[idx][MONSTER_DATA_INDEX_LEVEL] + MonsterObjNew[idx][MONSTER_DATA_INDEX_STR] + Math.floor(MonsterObjNew[idx][MONSTER_DATA_INDEX_ATK] * 1.2);
		}
		else {
			MonsterObjNew[idx][MONSTER_DATA_EXTRA_INDEX_ATK_MIN] = MonsterObjNew[idx][MONSTER_DATA_INDEX_STR];
			MonsterObjNew[idx][MONSTER_DATA_EXTRA_INDEX_ATK_MAX] = MonsterObjNew[idx][MONSTER_DATA_INDEX_ATK];
		}

		// 最小MATK、最大MATK
		MonsterObjNew[idx][MONSTER_DATA_EXTRA_INDEX_MATK_MIN] = MonsterObjNew[idx][MONSTER_DATA_INDEX_LEVEL] + MonsterObjNew[idx][MONSTER_DATA_INDEX_INT] + Math.floor(MonsterObjNew[idx][MONSTER_DATA_INDEX_MATK] * 0.8);
		MonsterObjNew[idx][MONSTER_DATA_EXTRA_INDEX_MATK_MAX] = MonsterObjNew[idx][MONSTER_DATA_INDEX_LEVEL] + MonsterObjNew[idx][MONSTER_DATA_INDEX_INT] + Math.floor(MonsterObjNew[idx][MONSTER_DATA_INDEX_MATK] * 1.2);
	}
};




